import React from 'react';

function CustomButton(props) {
  return (
    <button
      style={{
        backgroundColor: 'black',
        color: 'white',
        fontSize: '16px',
        padding: '15px 32px',
        margin: '4px 2px',
        cursor: 'pointer',
        textAlign: 'center',
        textDecoration: 'none',
        border: 'none',
      }}
    >
      {props.children}
    </button>
  );
}

 CustomButton();
